import { Component } from '@angular/core';
import { Movie } from '../movie';

@Component({
  selector: 'app-details',
  templateUrl: './details.component.html',
  styleUrls: ['./details.component.css']
})
export class DetailsComponent {

  movieList = [
    {
      title: "Teste Title",
      gender: 1,
      duration: 100
    },
    {
      title: "Teste Title 2",
      gender: 2,
      duration: 120
    },
    {
      title: "Teste Title 3",
      gender: 3,
      duration: 180
    }
  ]

  constructor(){}

  ngOnInit() : void{
  }
}
